package com.slaeggan.adventofcode;

import java.util.ArrayList;
import java.util.List;
import java.util.stream.Collectors;

public class DayFive {

    public static void main (String [] args) {
        var input = "dabAcCaCBAcCcaDA";
        var list = input.chars().mapToObj(c -> (char)c).collect(Collectors.toList());
        System.out.println(removePairs(list));
    }

    public static int removePairs(List<Character> chars ){
        int removed = 0;
        int indexPointer = 0;
        var changedChars = new ArrayList<Character>(chars.size());
        for(int i = 0; i < chars.size() - 1; i++) {
            var left = String.valueOf(chars.get(i));
            var right = chars.size() > i+1 ? String.valueOf(chars.get(i+1)) : "";
            if(left.equalsIgnoreCase(right) && !left.equals(right)){
                removed += 2;
                i++;
            } else {
                changedChars.add(chars.get(i));
                if(chars.size() == i +2) {
                    changedChars.add(chars.get(i+1));
                }
            }
        }
        if(removed > 0 ) {
            return removePairs(changedChars);
        }
        return changedChars.size();
    }

    private static String theInput = "";
}
